import React from "react";
import  ReactDOM  from "react-dom";
import OwlCarousel from 'react-owl-carousel';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';
import '../../public/static/file/css/main.css'
import Home from "./home";


const Ttemcard=(props)=>{
    return(
        <OwlCarousel  className="owl-carousel owl-theme" id="owl-settings" {...options}>
            <div className="item">
                <img src={props.img} alt="" />
                <h4 className="product1-title-english">{props.name}</h4> 
                <h4 className="product1-title-arabic">{props.arab}</h4>
                <h4 className="product1-price">&nbsp;<mark>{props.price}</mark></h4>
                <button className="add-to-cart">Add to Cart</button>
                </div> 
                                
                
        </OwlCarousel>
    )
}
export default Itemcard;
